

-- create the table of the carrito of the usuarios
create table if not exists pageweb.carrito_usuario (
id_usuario INT NOT NULL,
id_producto int not null,
foreign key(id_usuario) references pageweb.users(id),
foreign key(id_producto) references pageweb.products(idproducts));


--create the table of the services in this proyect
 CREATE TABLE `pageWeb`.`services` (
 `idservices` INT NOT NULL auto_increment,
 `nameServices` VARCHAR(500) NOT  NULL,
 `imagesServices` VARCHAR (500) NOT NULL,
 `descriptionServices` VARCHAR (500) NOT NULL,
 `priceServices` DECIMAL NOT NULL,
 `categoryServices` VARCHAR(500) NOT NULL,
 PRIMARY KEY(`idservices`));
 

